import React from 'react'
import { Link } from 'react-router-dom'
import './Navigation.css'
import logoHome from "../images/mepelaozen.png"
import whatsapp from "../images/whatsapp.png"
import facebook from "../images/facebook.png"
import instagram from "../images/instagram.png"
import { useDispatch, useSelector } from 'react-redux'
import styled from 'styled-components'
import { logoutUser } from '../store/AuthSlice'
import { toast } from 'react-toastify'
import {AiOutlineClose,AiOutlineMenu} from 'react-icons/ai'


function Navigation() {

  const dispatch = useDispatch()

  const {cartTotalQuantity} = useSelector((state)=>state.cart)
  const auth = useSelector((state)=>state.auth)

  return (
    <div className=' flex justify-between items-center h-24 max-w-[1240px] mx-auto px-4 text-black'>
      <Link to="/home"><img src={logoHome} alt="לוגו למסך הבית" width="180px"/></Link>
      <ul className='flex hidden'>
        <li className='p-4'>אביזרים</li>
        <li className='p-4'>Samsung</li>
        <li className='p-4'>AirPods</li>
        <li className='p-4'>Iphone</li>
        <li className='p-4'>Ipad</li>
        <li className='p-4'>Watch</li>
        <li className='p-4'>Mac</li>
      </ul>

        <div>
          <AiOutlineMenu size={20}/>
        </div>

        <div className='fixed left-0 top-0 w-[60%] border-r border-r-gray-900'> 
          <ul>
          <li className='p-4'>אביזרים</li>
        <li className='p-4'>Samsung</li>
        <li className='p-4'>AirPods</li>
        <li className='p-4'>Iphone</li>
        <li className='p-4'>Ipad</li>
        <li className='p-4'>Watch</li>
        <li className='p-4'>Mac</li>
          </ul>
        </div>

    </div>
  )
}

export default Navigation

// const Logout = styled.div`
//   color: black;
//   cursor: pointer;
// `


const AuthLinks = styled.div`
display: flex;
justify-content: end;
margin-right: 2rem;

  a{
    &:last-child{
      margin-left: 2rem;
    }
  }
`


const Links = styled.div`
  display: flex;
  div{
    cursor: pointer;
    &:last-child{
      margin-left: 2rem;
    }
  }
`
